import img from '../../images/Digital-Marketing-Company-India2.gif'
const BlogsHeader = () => {
    return (
        <div>
            <img
                src={img}
                style={{
                    minHeight: "10%",
                    maxHeight: 300,
                }}
                className="d-block w-100"
                alt="..."
            />


            <div class="centered">Centered</div>

        </div>
    );
};

export default BlogsHeader;
